Method.Implementation:
    set sc = $$$OK
    if ..#IDPROPERTY '= "" {
        if insert {
            set IdLocation = ##class(%Dictionary.ClassDefinition).%OpenId(..%ClassName(1)).Storages.GetAt(1).IdLocation
            if $Get(^MIGRATION.HFSQL,0) { // DURING HFSQL MIGRATION
                if $PROPERTY(,..#IDPROPERTY) = "" {
                    set $PROPERTY(,..#IDPROPERTY) = $Get(@IdLocation,0) + 1 
                }
                if $PROPERTY(,..#IDPROPERTY) >= $Get(@IdLocation,1) {
                    set @IdLocation = $PROPERTY(,..#IDPROPERTY) - 1
                } 
            } 
            else { // AFTER HFSQL MIGRATION 
                set $PROPERTY(,..#IDPROPERTY) = $Get(@IdLocation,0) + 1
            }
        }
    } else {
        set sc = $system.Status.Error(5001,..#ERRORMSG _ ..%ClassName(1)) 
    }
	return sc

Trigger.Code:
    #; set id = {ID}
    #; &sql(UPDATE ACHATS_TEXTES_TEST set IDACHATS_TEXTES = :id WHERE ID = :id)

    set class = ##class(%Dictionary.ClassDefinition).%OpenId(..%ClassName(1))
    set tablename = class.SqlTableName
    set (idproperty,idcolumn) = ""

    for i=1:1:class.Parameters.Count() {
        if class.Parameters.GetAt(i).Name = "IDPROPERTY" {
            set idproperty = class.Parameters.GetAt(i).Default
            quit
        }
    }
    if idproperty '= "" {
        for i=1:1:class.Properties.Count() {
            if class.Properties.GetAt(i).Name = idproperty {
                set idcolumn = class.Properties.GetAt(i).SqlFieldName
                quit
            }
        }
        if idcolumn '= "" {
            kill sql
            set sql($i(sql))="UPDATE " _ $PIECE(class.Name,".") _"."_ tablename
            set sql($i(sql))="SET  " _ idcolumn _ " = ?"
            set sql($i(sql))="WHERE ID = ?"
            do ##class(%SQL.Statement).%ExecDirect(,.sql,{ID},{ID})
        }
    } else {
        set %ok = 0
        set %msg = ..#ERRORMSG _ tablename
    }

