Method.Implementation:
set status = $$$OK set tProxy = []
try{ set start=$zh set daysToKeep=0,keepIntegrity=0,bodiesToo=1,deleted=0 set sc=##class(Ens.Purge).PurgeAll(.deleted,daysToKeep,keepIntegrity,bodiesToo) set tProxy.BitmapChunks=$g(deleted("Bitmap Chunks"))_" deleted" set tProxy.BusinessProcesses=$g(deleted("Business Processes"))_" deleted" set tProxy.BusinessRuleLogs=$g(deleted("Business Rule Logs"))_" deleted" set tProxy.EnsembleMessages=$g(deleted("Ensemble Messages"))_" deleted" set tProxy.EventLogs=$g(deleted("Event Logs"))_" deleted" set tProxy.HostMonitorData=$g(deleted("Host Monitor Data"))_" deleted" set tProxy.IOLogs=$g(deleted("I/O Logs"))_" deleted" set tProxy.ManagedAlerts=$g(deleted("Managed Alerts"))_" deleted" set tProxy.MessageBodies=$g(deleted("Message Bodies"))_" deleted" set:'sc tProxy.status = $system.Status.GetErrorText(sc) set tProxy.purge=deleted_" deleted" &sql(delete from agl_msg.orderconfirmation) set tProxy.AglMsgOrderConfirmation=%ROWCOUNT_" deleted" &sql(delete FROM EnsLib_Workflow.Worklist) set tProxy.EnsLibWorkflowWorklist=%ROWCOUNT_" deleted" &sql(delete FROM EnsLib_Workflow.TaskRequest) set tProxy.EnsLibWorkflowTaskRequest=%ROWCOUNT_" deleted" &sql(delete FROM EnsLib_Workflow.TaskResponse) set tProxy.EnsLibWorkflowTaskResponse=%ROWCOUNT_" deleted" set sc=##class(%DeepSee.Utils).%BuildCube("AGLCommandes",0,0) set:sc tProxy.AGLCommandes="cube rebuilt successfully" set tProxy.elapse=$num($zh-start,2)_" seconds" set JSON=tProxy.%ToJSON() do pOutput.Write(JSON)
} catch (e) { set status = e.AsStatus() set tProxy.error = $system.Status.GetErrorText(status)_"("_$system.Status.GetErrorCodes(status)_")" } set sc=##class(%ZEN.Auxiliary.jsonProvider).%WriteJSONStreamFromObject(.pOutput,.tProxy,,,,"iw") do pOutput.Clear() set JSON=tProxy.%ToJSON() for i=1:1:$l(JSON,",") { set sc=pOutput.WriteLine($p(JSON,",",i)) } do pOutput.Rewind() do:$$$ISOK(sc) pOutput.SetAttribute("Content-Type","application/json") quit $$$OK

	set sc = $$$OK
	Try {
		set pResponse = ##class(Exparf.msg.replication.response).%New()
        set pResponse.sTable = pRequest.sTable
        set pResponse.sCle = pRequest.sCle
        set pResponse.nIdentifiant = pRequest.nIdentifiant
        set pResponse.sAction = pRequest.sAction
        set pResponse.dhDateCreation = pRequest.dhDateCreation

        set query = "SELECT * FROM " _ pRequest.sTable _ " WHERE " _ pRequest.sCle _ " = " _ pRequest.nIdentifiant
        $$$TRACE("query :" _ query )
        set sc = ..Adapter.ExecuteQuery(.rs,query)
        
        if 'sc {
            $$$LOGERROR("ERROR WHILE SELECTING DATA FROM " _ pRequest.sTable _" : " _  $SYSTEM.Status.GetErrorText(sc))
            set pResponse.status = sc
        }
        else {

            $$$TRACE("nb columns:" _ rs.GetColumnCount())
            
            while rs.%Next() {
                for i=1:1:rs.GetColumnCount() {
                    $$$TRACE(rs.GetColumnName(i) _"=" _ rs.%GetData(i) _ " type : " _ rs.GetColumnType(i) _ " SQL type : " _ rs.GetColumnSQLType(i))
                }
                /// INSERT
                if pRequest.sAction = "HAjoute" {
                    set sql($i(sql)) = "insert into Exparf." _ pRequest.sTable 
                    set sql($i(sql)) = " ("

                    for i=1:1:rs.GetColumnCount() {
                        if rs.%GetData(i) '= "" {
                            set sql($i(sql)) = rs.GetColumnName(i)
                            if i<rs.GetColumnCount() {
                                set sql($i(sql)) = ","
                            }
                        }
                    }
                    set sql($i(sql)) = ")"
                    set sql($i(sql)) = " VALUES "
                    set sql($i(sql)) = " ("
                    for i=1:1:rs.GetColumnCount() {
                        if rs.%GetData(i) '= "" {
                            if rs.GetColumnType(i) = "DATE" {
                                if $LENGTH(rs.%GetData(i))=8 {
                                    set sql($i(sql)) = " to_date('" _ rs.%GetData(i) _ "','YYYYMMDD')"
                                } else {
                                    set sql($i(sql)) = "'" _ rs.%GetData(i) _ "'"
                                }
                            } 
                            else {
                                set sql($i(sql)) = "'" _ rs.%GetData(i) _ "'"
                            }
                            if i<rs.GetColumnCount() {
                                set sql($i(sql)) = ","
                            }
                        }
                    }
                    set sql($i(sql)) = ")"
                }
                /// UPDATE
                if pRequest.sAction = "HModifie" {
                    set sql($i(sql)) = "update Exparf." _ pRequest.sTable 
                    set sql($i(sql)) = " ("

                    for i=1:1:rs.GetColumnCount() {
                        set sql($i(sql)) = rs.GetColumnName(i)
                        if i<rs.GetColumnCount() {
                            set sql($i(sql)) = ","
                        }
                    }
                    set sql($i(sql)) = ")"
                    set sql($i(sql)) = " VALUES "
                    set sql($i(sql)) = "("
                    for i=1:1:rs.GetColumnCount() {
                        set sql($i(sql)) = "'" _ $replace(rs.%GetData(i),"'","''") _ "'"
                        if i<rs.GetColumnCount() {
                            set sql($i(sql)) = ","
                        }
                    
                    }
                    set sql($i(sql)) = ")"
                }
                /// DELETE
                if pRequest.sAction = "HSupprime" {
                    set sql($i(sql)) = "delete Exparf." _ pRequest.sTable _ " WHERE " _ pRequest.sCle _ " = " _ pRequest.nIdentifiant
                }
                /// EXECUTE 
                set stmt = ##class(%SQL.Statement).%New()

                set key=""
                do {
                    set key = $order(sql(key),1,data)
                    if key '= "" {
                        set pResponse.query = pResponse.query _ data
                    }
                } while key '= ""
                

                set sc = stmt.%Prepare(.sql)
                set result = stmt.%Execute()
                /// RESULT
                set pResponse.sqlcode = result.%SQLCODE
                set pResponse.rowcount = result.%ROWCOUNT
                set pResponse.message = result.%Message
                set pResponse.statementType = result.%StatementTypeName

                if result.%SQLCODE = 0 {
                    set msg = "SQLCODE:" _ result.%SQLCODE _ " : " _ result.%ROWCOUNT _ " successfully "
                    if pRequest.sAction = "HAjoute"  {
                        set msg = msg _ "inserted in" 
                    }
                    if pRequest.sAction = "HModifie"  {
                        set msg = msg _ "updated"
                    }
                    if pRequest.sAction = "HSupprime"  {
                        set msg = msg _ "deleted from"
                    }
                    set msg = msg _ " table " _ pRequest.sTable _ " in IRIS"
                    $$$LOGINFO(msg)
                } else {
                    set msg = "SQLCODE:" _ result.%SQLCODE _ " : ERROR WHILE "
                    if pRequest.sAction = "HAjoute"  {
                        set msg = msg _ "inserting in"
                    }
                    if pRequest.sAction = "HModifie"  {
                        set msg = msg _ "updating"
                    }
                    if pRequest.sAction = "HSupprime"  {
                        set msg = msg _ "deleting from"
                    }
                    set msg = msg _ " table " _ pRequest.sTable _ " in IRIS : " _ $SYSTEM.Status.GetErrorText(sc)
                    $$$LOGWARNING(msg)
                }  
                }
            }
            do pResponse.%Save()
	}
	Catch ex {
		Set sc=ex.AsStatus()
	} 
    
	return sc
